function onWindowResize() {

    windowHalfX = window.innerWidth / 2;
    windowHalfY = window.innerHeight / 2;

    camera.aspect = window.innerWidth / window.innerHeight;
    camera.updateProjectionMatrix();

    renderer.setSize(window.innerWidth, window.innerHeight);

    controls.handleResize();

    effectFXAA.uniforms['resolution'].value.set(1 / window.innerWidth, 1 / window.innerHeight);

    composer.reset();

}



//

function onDocumentMouseMove(event) {

    mouseX = event.clientX - windowHalfX;
    mouseY = event.clientY - windowHalfY;

}

function onDocumentTouchStart(event) {

    if (event.touches.length > 1) {

        event.preventDefault();

        mouseX = event.touches[0].pageX - windowHalfX;
        mouseY = event.touches[0].pageY - windowHalfY;

    }

}

function onDocumentTouchMove(event) {

    if (event.touches.length == 1) {

        event.preventDefault();

        mouseX = event.touches[0].pageX - windowHalfX;
        mouseY = event.touches[0].pageY - windowHalfY;
    }

}


function autoRot() {
    autoOnOff = 1;
    autoRotOnOff = 0;
}






//

function animate() {

    requestAnimationFrame(animate);
    render();

    stats.update();
    controls.update();

}

function render() {

    camGRP.rotation.y = mouseX * 0.01;
    camGRP.rotation.x = mouseY * 0.0001;

    //camera.position.x += (mouseX - camera.position.x) * .005 * autoOnOff;
    //camera.position.y += (-mouseY + 200 - camera.position.y) * .05 * autoOnOff; 

    camera.lookAt(scene.position);

    //console.log(camera.position);

    var time = Date.now() * 0.0003;

    for (var i = 0; i < scene.children.length; i++) {

        var object = scene.children[i];
        if (object instanceof THREE.Line) object.rotation.y = time * (i % 2 ? 1 : 1) * autoRotOnOff;

    }

    //renderer.clear();
    composer.render();

}
